// MAPA DE TRANSMISIONES MEJORADO PARA EL POTOSÍ
const MAPA_TRANSMISIONES = {
    'Manual': 'MANUAL',
    'Automática': 'AUTO',
    'DSG': 'DSG',              // Direct Shift Gearbox (VW Group)
    'DCT': 'DCT',              // Dual Clutch Transmission
    'CVT': 'CVT',              // Continuously Variable Transmission
    'Tiptronic': 'TIPTRONIC',  // Tiptronic (VW/Audi)
    'Selespeed': 'SELESPEED',  // Selespeed (Alfa Romeo)
    'Especial': 'ESPECIAL',
    'No especificada': 'NO_ESPECIFICADA'
};

// FUNCIONES DE NORMALIZACIÓN
function normalizarTexto(texto) {
    if (!texto) return '';
    return String(texto)
        .toUpperCase()
        .normalize('NFD')
        .replace(/[\u0300-\u036f]/g, '')
        .replace(/[^A-Z0-9\s]/g, '')
        .replace(/\s+/g, ' ')
        .trim();
}

function normalizarMarca(marca) {
    if (!marca) return '';
    const marcaNormalizada = normalizarTexto(marca);

    for (const [canonical, sinonimos] of Object.entries(MARCAS_CANONICAS)) {
        if (sinonimos.includes(marcaNormalizada) || marcaNormalizada === canonical.replace('-', ' ')) {
            return canonical;
        }
    }
    return marcaNormalizada;
}

function normalizarVersion(version) {
    if (!version) return '';
    return String(version)
        .toUpperCase()
        .normalize('NFD')
        .replace(/[\u0300-\u036f]/g, '')
        // Eliminar información técnica específica de El Potosí
        .replace(/\bL\d+\b/gi, '')                    // L4, L6
        .replace(/\b[VI]\d+\b/gi, '')                 // V6, V8, I4
        .replace(/\b\d+\.\d+\s*L?\b/gi, '')           // 1.5L, 2.0, 2.4, 3.5L
        .replace(/\b\d+L\b/gi, '')                    // 2L, 4L
        .replace(/\b\d+\s*CIL\.?\b/gi, '')            // 4CIL, 6 CIL
        .replace(/\b\d+\s*CL\b/gi, '')                // 3CL (cilindros)
        .replace(/\b\d+\s*HP\b/gi, '')                // 82 HP
        .replace(/\b\d+\s*PTAS?\b/gi, '')             // 4 PTAS, 5 PTA
        .replace(/\b\d+\s*OCUP\b/gi, '')              // 5 OCUP
        .replace(/\bN\/A\b/gi, '')                    // N/A
        .replace(/\bTON\b/gi, '')                     // TON
        .replace(/\bAÑO:?\s*\d+\b/gi, '')             // Año: 2010
        // Eliminar equipamiento específico
        .replace(/\bABS\b/gi, '')                     // ABS
        .replace(/\bA\/A\b/gi, '')                    // A/A (aire acondicionado)
        .replace(/\bE\/E\b/gi, '')                    // E/E (elevadores eléctricos)
        .replace(/\bTELA\b/gi, '')                    // TELA
        .replace(/\bPIEL\b/gi, '')                    // PIEL
        .replace(/\bQ\/C\b/gi, '')                    // Q/C (quemacocos)
        .replace(/\bB\/A\b/gi, '')                    // B/A (bolsa de aire)
        .replace(/\bCRISTAL\b/gi, '')                 // CRISTAL
        // Eliminar información de transmisión de la versión (ya se captura aparte)
        .replace(/\bSTD\b/gi, '')                     // STD
        .replace(/\bAUT\b/gi, '')                     // AUT
        .replace(/\bMT\b/gi, '')                      // MT
        .replace(/\bAT\b/gi, '')                      // AT
        .replace(/\bA\/S\b/gi, '')                    // A/S
        // Limpiar caracteres especiales
        .replace(/[^A-Z0-9\s-]/g, '')
        .replace(/\s+/g, ' ')
        .trim();
}

function normalizarVersionUniversal(versionCompleta, versionCorta, transmisionNorm) {
    // En El Potosí, VersionCorta parece ser más descriptiva en muchos casos
    const versionParaNormalizar = (versionCorta && 
                                   versionCorta.trim() !== '' && 
                                   !versionCorta.includes('N/A')) 
                                   ? versionCorta : versionCompleta;

    let versionNorm = normalizarVersion(versionParaNormalizar);

    // Extraer versiones comunes de El Potosí
    const patrones = [
        /\b(EXECUTIVE|EJECUTIVE)\b/gi,
        /\b(SPORT|SPORTS|SPORTY)\b/gi,
        /\b(STYLE)\b/gi,
        /\b(ATTRACTION|ATTRACTION PLUS)\b/gi,
        /\b(COMFORT|CONFORT)\b/gi,
        /\b(PREMIUM|PREM)\b/gi,
        /\b(LUXURY|LUX|LUJO)\b/gi,
        /\b(ELITE)\b/gi,
        /\b(LIMITED|LTD|LIMITADA)\b/gi,
        /\b(BASE|BASICO|BASICA)\b/gi,
        /\b(CABRIOLET|CABRIO|CONVERTIBLE|CONV)\b/gi,
        /\b(COUPE|COUP)\b/gi,
        /\b(SEDAN)\b/gi,
        /\b(HATCHBACK|HATCH)\b/gi,
        /\b(EXCLUSIVE)\b/gi,
        /\b(ADVANCE|ADVANCED)\b/gi,
        /\b(SELESPEED)\b/gi,
        /\b(TRIPTONIC|TIPTRONIC)\b/gi
    ];

    for (const patron of patrones) {
        const match = versionNorm.match(patron);
        if (match) {
            let version = match[0].toUpperCase().replace(/\s+/g, '-');
            // Normalizar variaciones
            if (version.includes('EJECUTIVE')) return 'EXECUTIVE';
            if (version.includes('ATTRACTION-PLUS')) return 'ATTRACTION-PLUS';
            if (version.includes('ATTRACTION')) return 'ATTRACTION';
            if (version.includes('SPORT')) return 'SPORT';
            if (version.includes('STYLE')) return 'STYLE';
            if (version.includes('COMFORT') || version.includes('CONFORT')) return 'COMFORT';
            if (version.includes('PREMIUM') || version.includes('PREM')) return 'PREMIUM';
            if (version.includes('LUXURY') || version.includes('LUX') || version.includes('LUJO')) return 'LUXURY';
            if (version.includes('ELITE')) return 'ELITE';
            if (version.includes('LIMITED') || version.includes('LTD') || version.includes('LIMITADA')) return 'LIMITED';
            if (version.includes('BASE') || version.includes('BASICO') || version.includes('BASICA')) return 'BASE';
            if (version.includes('CABRIOLET') || version.includes('CABRIO') || version.includes('CONVERTIBLE') || version.includes('CONV')) return 'CABRIOLET';
            if (version.includes('COUPE') || version.includes('COUP')) return 'COUPE';
            if (version.includes('SEDAN')) return 'SEDAN';
            if (version.includes('HATCHBACK') || version.includes('HATCH')) return 'HATCHBACK';
            if (version.includes('EXCLUSIVE')) return 'EXCLUSIVE';
            if (version.includes('ADVANCE')) return 'ADVANCE';
            if (version.includes('SELESPEED')) return 'SELESPEED';
            if (version.includes('TRIPTONIC') || version.includes('TIPTRONIC')) return 'TIPTRONIC';
            return version;
        }
    }

    // Si no encuentra patrón, usar la primera palabra significativa
    const palabras = versionNorm.split(' ').filter(p => p.length > 2 && !['AÑOS', 'AÑO'].includes(p));
    return palabras.length > 0 ? palabras[0] : 'STANDARD';
}

function normalizarTransmision(transmisionDesc) {
    if (!transmisionDesc) return 'NO_ESPECIFICADA';
    return MAPA_TRANSMISIONES[transmisionDesc] || 'NO_ESPECIFICADA';
}

// FUNCIÓN MEJORADA: Detectar transmisión desde descripción si no está especificada
function detectarTransmisionDesdeDescripcion(versionCompleta) {
    if (!versionCompleta) return null;

    const descripcionUpper = versionCompleta.toUpperCase();

    // Orden de prioridad para detección - El Potosí usa mucho DSG
    if (descripcionUpper.includes('DSG')) return 'DSG';
    if (descripcionUpper.includes('DCT')) return 'DCT';
    if (descripcionUpper.includes('CVT')) return 'CVT';
    if (descripcionUpper.includes('TIPTRONIC') || descripcionUpper.includes('TRIPTONIC')) return 'TIPTRONIC';
    if (descripcionUpper.includes('SELESPEED')) return 'SELESPEED';
    if (descripcionUpper.includes('STRONIC')) return 'DSG';  // Audi usa S-Tronic
    if (descripcionUpper.includes('MULTITRONIC')) return 'CVT';  // Audi usa Multitronic
    // Patrones de automática
    if (descripcionUpper.includes('AUT') || descripcionUpper.includes('AUTO')) return 'AUTO';
    if (descripcionUpper.includes(' AT ') || descripcionUpper.includes('AT,')) return 'AUTO';
    if (descripcionUpper.includes('A/S')) return 'AUTO';
    // Patrones de manual
    if (descripcionUpper.includes('STD')) return 'MANUAL';
    if (descripcionUpper.includes(' MT ') || descripcionUpper.includes('MT ') || descripcionUpper.includes(' MT,')) return 'MANUAL';
    if (descripcionUpper.includes('MAN')) return 'MANUAL';

    return null;
}

function generarHash(...componentes) {
    const textoHash = componentes
        .map(c => String(c || '').toUpperCase().trim())
        .join('|');

    return crypto
        .createHash('sha256')
        .update(textoHash, 'utf8')
        .digest('hex');
}

// PROCESAMIENTO PRINCIPAL
const items = $input.all();
const registros = [];
const fechaProceso = new Date().toISOString();

let estadisticas = {
    total: 0,
    conTransmision: 0,
    sinTransmision: 0,
    transmisionDetectada: 0,
    transmisionNoEspecificada: 0,
    tiposDetectados: {
        DSG: 0,
        DCT: 0,
        CVT: 0,
        TIPTRONIC: 0,
        SELESPEED: 0,
        AUTO: 0,
        MANUAL: 0
    }
};

for (const item of items) {
    const data = item.json;

    if (!data.marca || !data.modelo || !data.año) {
        continue;
    }

    estadisticas.total++;

    const marcaNormalizada = normalizarMarca(data.marca);
    const modeloNormalizado = normalizarTexto(data.modelo);

    // MEJORADO: Normalización de transmisión con detección desde descripción
    let transmisionNormalizada = normalizarTransmision(data.transmision_descripcion);

    // Si la transmisión no está especificada, intentar detectarla desde la descripción
    if (transmisionNormalizada === 'NO_ESPECIFICADA' && data.version_completa) {
        const transmisionDetectada = detectarTransmisionDesdeDescripcion(data.version_completa);
        if (transmisionDetectada) {
            transmisionNormalizada = transmisionDetectada;
            estadisticas.transmisionDetectada++;
            // Contar tipo detectado
            if (estadisticas.tiposDetectados[transmisionDetectada]) {
                estadisticas.tiposDetectados[transmisionDetectada]++;
            }
        } else {
            estadisticas.transmisionNoEspecificada++;
        }
    } else if (transmisionNormalizada !== 'NO_ESPECIFICADA') {
        estadisticas.conTransmision++;
    }

    const versionNormalizada = normalizarVersionUniversal(
        data.version_completa, 
        data.version_corta, 
        transmisionNormalizada
    );

    const versionCortaNormalizada = data.version_corta ? 
        normalizarVersionUniversal(data.version_corta, null, transmisionNormalizada) : 
        versionNormalizada;

    const hashUnico = generarHash(
        marcaNormalizada,
        modeloNormalizado,
        data.año,
        versionNormalizada,
        transmisionNormalizada
    );

    const registro = {
        hash_unico: hashUnico,
        marca: data.marca,
        modelo: data.modelo,
        año: data.año,
        version: data.version_completa,
        version_corta: data.version_corta || null,
        transmision_codigo: data.transmision_codigo,
        transmision_descripcion: data.transmision_descripcion,
        transmision_normalizada: transmisionNormalizada,
        transmision_original: data.transmision_original,
        transmision_detectada_desc: data.transmision_detectada_desc === 1,
        marca_normalizada: marcaNormalizada,
        modelo_normalizado: modeloNormalizado,
        version_normalizada: versionNormalizada,
        version_corta_normalizada: versionCortaNormalizada,
        catalogo_marca_id: data.catalogo_marca_id,
        catalogo_modelo_id: data.catalogo_modelo_id,
        catalogo_version_id: data.catalogo_version_id || null,
        origen_carga: 'etl_elpotosi_batch',
        fecha_proceso: fechaProceso,
        aseguradora_data: {
            aseguradora: 'ELPOTOSI',
            id_original: data.id_original,
            activo: data.activo !== undefined ? data.activo : 1,
            fecha_actualizacion: data.fecha_actualizacion,
            transmision_original: data.transmision_original,
            transmision_detectada_automaticamente: data.transmision_detectada_desc === 1
        },
        hash_components: {
            marca: marcaNormalizada,
            modelo: modeloNormalizado,
            año: data.año.toString(),
            version: versionNormalizada,
            transmision: transmisionNormalizada
        }
    };

    registros.push(registro);
}

return registros;

// Nodo: Deduplicate Source Data
const items = $input.all();
const seen = new Map();

for (const item of items) {
  const key = `${item.json.marca}|${item.json.modelo}|${item.json.año}|${item.json.version_completa}`;

  if (!seen.has(key) || item.json.fecha_actualizacion > seen.get(key).json.fecha_actualizacion) {
    seen.set(key, item);
  }
}

return Array.from(seen.values());

// Nodo: Deduplicate by Hash - CRÍTICO para evitar duplicados
const items = $input.all();
const uniqueByHash = new Map();
const duplicates = new Map();

// Procesar todos los items
items.forEach(item => {
  const hash = item.json.hash_unico;

  if (!hash) {
    return;
  }

  if (uniqueByHash.has(hash)) {
    // Contar duplicados
    if (!duplicates.has(hash)) {
      duplicates.set(hash, [uniqueByHash.get(hash)]);
    }
    duplicates.set(hash, [...duplicates.get(hash), item]);
  } else {
    uniqueByHash.set(hash, item);
  }
});

// Reportar duplicados encontrados
if (duplicates.size > 0) {  
  // Mostrar ejemplos de duplicados
  let exampleCount = 0;
  for (const [hash, items] of duplicates.entries()) {
    if (exampleCount >= 5) break;

    console.log(`\n🔍 Hash duplicado: ${hash.substring(0, 16)}...`);
    console.log(`   Registros: ${items.length}`);

    // Mostrar los primeros 2 registros del duplicado
    items.slice(0, 2).forEach((item, idx) => {
      const data = item.json;
    });

    exampleCount++;
  }

  // Análisis de por qué se duplican
  const duplicateAnalysis = new Map();
  for (const [hash, items] of duplicates.entries()) {
    const firstItem = items[0].json;
    const key = `${firstItem.marca_normalizada}|${firstItem.modelo_normalizado}`;

    if (!duplicateAnalysis.has(key)) {
      duplicateAnalysis.set(key, 0);
    }
    duplicateAnalysis.set(key, duplicateAnalysis.get(key) + 1);
  }

  const sortedAnalysis = Array.from(duplicateAnalysis.entries())
    .sort((a, b) => b[1] - a[1])
    .slice(0, 10);

  sortedAnalysis.forEach(([key, count]) => {
    console.log(`   ${key}: ${count} hashes duplicados`);
  });
}

// Estadísticas finales
const finalItems = Array.from(uniqueByHash.values());

return finalItems;
